            </Button>
          </li>
          <li>
            <Button variant="contained" onClick={handleSignOut}>
              Sign Out
            </Button>
          </li>
        </ul>
      </nav>
      {/* Render the content of each page based on the current route */}
      {/* ... */}
    </Container>
  );
}

export default ClientProfile;
